import React from 'react'
import {lePinchoElCarnal} from '../../store/prueba/action'
import { connect } from 'react-redux'
import prueba from './ot'

const Prueba = ({lePinchoElCarnal}) =>{
    return(
        <div>
            <button onClick={()=>lePinchoElCarnal()}>Pinchale aqui carnal!!</button>
        </div>
    )
}
lePinchoElCarnal = connect()(lePinchoElCarnal)

export default Prueba
